  [],\n\t\"revision_timestamp\": \"2016-08-31T04:20:28.012253\",\n\t\"name\": \"converged-registries-cr\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Converged Registries platform is a hardware
  and software architecture designed to host individual patient registries and eliminate
  duplicative development effort while maximizing VAs ability to create new patient
  registries.  The common platform includes a relational database, software classes,
  security modules, extraction services and other components.  The Converged Registries
  obtains data from the Corporate Data Warehouse (CDW), directly from the Veterans
  Health Information Systems and Technology Architecture (VistA) as well as by direct
  user input. Registries Projects - Embedded Fragment Registry (EFR), Eye Injury Data
  Store, Traumatic Brain Injury (TBI) Registry and Veterans Implant Tracking and Alert
  System (VITAS).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
